deck_description:
Since Dark Ruler is good this format (and since everyone is now playing Mine), I've pivoted to a non-Mine reliant build in anticipation of its inevitable ban.

&nbsp;

The deck has a lot more viable board breakers now beyond just Droplet, which helps push this build a long way.

I wanted to see how far I could push Inzektor, and I found <a rel="nofollow" href="https://ygoprodeck.com/author/chaos-replayer/">chaos replayer's</a>  deck featuring an FTK enabled by Chaos Dyson Sphere, so I thought, "Why not? What's the harm? It probably won't work, but let's see if it can!". And, I've got to admit, It Works. We use ZS Ascended Sage to search Rank-Up-Magic Barian's Force or Rank-Up-Magic Astral Force, flood the field with Inzektors to make two Lv 7's, sue Saryuja Skull Dread to draw into our other Rank-Up spell, and make a meaty Gossip Shadow to attach as material to our Dyson Sphere. Our Plan B, if this doesn't work, is to make Utopia Dragner, summon out Diablosis the Mind Hacker and rip a card from the opponent's extra deck, then use The Phantom Knights' Rank-Up-Magic Launch to make D/D/D Duo-Dawn King Kali Yuga on the opponent's turn, locking them out of activated effects on the field. I don't know if this deck is good, but its fun, and its an interesting take on Inzektor that I haven't seen represented yet.

&nbsp;

Have fun!

I think the deck explains itself. Eldlich is a strong meta deck that can almost always keep up. You could also play Lostwind instead of Impermanence and in the Extra deck you have a lot of flex spots.

&nbsp;

https://youtu.be/e1-MxAq4TQI

Infernoble is definitely a very solid deck that got new support in POTE with Eka. This build of the deck has the goal of making its endboards as consistent as possible. For this we play 3x Red Layer 3x Fire Flint and so on. Since Auroradon was banned the deck is unfortunately not a 1 card combo deck anymore, but a 2 card combo deck. The new variant has many positive sides like the high constant or or the possibilities to break boards. But still it has weaknesses like the bad recovery or the high handtrap vulnerability.... The build is inspired by Team COG's deck. The test hand video is below in the link:

https://youtu.be/a5WIO5RECfE

